import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <div className="menu">
      <Link to="/">work </Link>
      <Link to="/">contact</Link>
    </div>
  );
};

export default Navbar;
